import React from "react";

const DownloadFile = (props) => {
	const { blob } = props;
	const link = document.createElement('a');
	link.href = blob;
	link.setAttribute('download', 'normalsImage.gif');
	document.body.appendChild(link);
	link.click();
};

export default DownloadFile;
